import React, { Component } from "react";

//CLASS BASE
class MenuMinuman extends Component {
  render() {
    return (
      <div style={{ border: "1px solid black", width: 300, margin: "auto" }}>
        <p>Nama Menu : {this.props.namaMenu}</p>
        <p>Harga : Rp. 15.000</p>
      </div>
    );
  }
}

export default MenuMinuman;
